.header {
  .logo {
    height: 30px;
    width: 350px;
  }
  .nav {
    &__header {
      text-transform: uppercase;
      font-size: 14px;
      font-weight: 400;
    }
  }
  .hamburger {
    position: relative;
    top: 5px;
    height: 10px;
    &--line {
      background-color: #fff;
      width: 22px;
      height: 1px;
      margin-bottom: 6px;
    }
  }
}
.landing-page {
  .arrow-container {
    @include flex(row, space-between, center);
    padding: 0 75px;
    position: relative;
    top: 45%;
    .arrow {
      width: 9px;
    }
  }
  .caerousel-container {
    width: 7px;
    margin: auto;
    position: relative;
    top: 85%;
    .caerousel {
      margin: 0 20px;
      height: 22px;
    }
  }
}
.booking {
  &__header {
    color: $primary;
    font-size: 24px;
    text-transform: capitalize;
    font-weight: 400;
    margin-bottom: 40px;
  }
  &__check {
    @include flex(row, space-between, center);
    margin: 20px 0;
  }
  &__select {
    @include flex(row, flex-start, center);
  }

  &__parg {
    text-transform: uppercase;
    font-size: 18px;
    font-weight: 600;
  }
  &__input {
    border: none;
    border-bottom: 1px solid rgb(163, 163, 163);
  }
  .select {
    border: none;
    margin-left: 20px;
  }
}
.gallery {
  &__header {
    text-align: left;
    margin: 30px 20px;
    text-transform: uppercase;
    font-size: 22px;
  }
  &__parg {
    margin: 50px 20px 10px 20px;
    text-align: left;
    text-transform: capitalize;
    font-size: 14px;
  }
  &__slider {
    margin: 15px 20px;
    text-align: left;
    color: white;
  }
  &__img {
    @include flex(row, center, center);
    width: 100%;
    height: 100px;
    * {
      height: 100%;
      width: 50%;
    }
  }
}
.description {
  &__menu {
    width: 100%;
    height: 55px;
    background-color: $primary;
  }
  &__list {
    @include flex(row, space-evenly, center);
    height: 100%;
    padding: 0;
  }
  &__link {
    text-align: center;
    font-size: 12px;
    color: #fff;
    text-transform: capitalize;
  }
  &__header {
    font-size: 24px;
    font-weight: 400;
    text-align: left;
    margin: 40px 40px 25px 40px;
  }
  &__card {
    text-align: center;
    margin: 0 30px;
    background-color: $primary;
    color: #fff;
  }

  &__parg {
    margin: 30px 35px;
    line-height: 1.6;
    font-size: 12px;
    text-transform: capitalize;
  }
  &__btn {
    margin: 15px auto;
  }
  &__img {
    width: 100%;
  }
}
.testimonial {
  &__header {
    font-size: 28px;
    font-weight: 400;
    text-transform: capitalize;
    margin-bottom: 50px;
  }
  &__card {
    width: 60%;
    margin: 30px auto;
    border: 1px solid black;
  }
}
